    function sendDiscordAlert(webhookUrl, playerNick, npc, mapName, serverName) {
        let color = 8388608 //red
        let type1 = 'Tytan'
        let type2 = 'tytana'
        if (isHeros(npc)) {
            type1 = 'Heros'
            type2 = 'herosa'
            color = 8388736 //purple
        }
        else if (isAdditionalNpcToSearch(npc)) {
            type1 = ''
            type2 = 'npca'
            color = 12320855 //dark pink
        }

        let addToThumbnail = ''
        if (getCookie('interface') === 'ni') {
            addToThumbnail = 'https://micc.garmory-cdn.cloud/obrazki/npc/'
        }
        //if (!npc.icon.startsWith('/')) npc.icon = '/' + npc.icon

        const request = new XMLHttpRequest()
        request.open('POST', webhookUrl, true)
        request.setRequestHeader('Content-Type', 'application/json')
        request.send(JSON.stringify({
            content: `**@here ${type1}:** ${npc.nick} - ${mapName} (${npc.x}, ${npc.y})`,
            username: 'WysÅ‚annik zakonu',
            avatar_url: 'https://micc.garmory-cdn.cloud/obrazki/npc/bur/zr_ithan.gif',
            embeds: [{
                color: color,
                title: `${playerNick} znalazÅ‚ ${type2}!`,
                description: `${npc.nick} - ${mapName} (${npc.x}, ${npc.y}) - ${serverName}`,
                thumbnail: {
                    url: `${addToThumbnail}${npc.icon}`
                },
                timestamp: new Date().toISOString()
            }]
        }))
    }

    function isHeros(npc) {
        return npc.wt > 79 && npc.wt <= 99
    }

    function isAdditionalNpcToSearch(npc) {
        return additionalNpcNamesToSearch.includes(npc.nick)
    }

    function closePopup() {
        document.body.removeChild(document.getElementById('heroes-popup'))
    }

    function getServerName() {
        if (getCookie('interface') === 'ni') {
            return Engine.worldName[0].toUpperCase() + Engine.worldName.slice(1)
        }
        else {
            return g.worldname[0].toUpperCase() + g.worldname.slice(1)
        }

    }


